OthAgr:
Recalling its resolutions 2042 (2012), 2043 (2012), 2118 (2013), 2139 (2014), 2165 (2014), 2170 (2014), 2175 (2014), 2178 (2014), 2191 (2014), 2199 (2015), 2235 (2015), and 2249 (2015) and Presidential Statements of 3 August 2011 (S/PRST/2011/16), 21 March 2012 (S/PRST/2012/6), 5 April 2012 (S/PRST/2012/10), 2 October 2013 (S/PRST/2013/15), 24 April 2015 (S/PRST/2015/10) and 17 August 2015 (S/PRST/2015/15);

Commending the commitment of the ISSG, as set forth in the Joint Statement on the outcome of the multilateral talks on Syria in Vienna of 30 October 2015 and the Statement of the ISSG of 14 November 2015 (hereinafter the “Vienna Statements”)

Page 2, Bearing in mind the goal to bring together the broadest possible spectrum of the opposition, chosen by Syrians, who will decide their negotiation representatives and define their negotiation positions so as to enable the political process to begin, taking note of the meetings in Moscow and Cairo and other initiatives to this end, and noting in particular the usefulness of the meeting in Riyadh on 9-11 December 2015, whose outcomes contribute to the preparation of negotiations under UN auspices on a political settlement of the conflict, in accordance with the Geneva Communique and the “Vienna Statements”, and looking forward to the Secretary- General’s Special Envoy for Syria finalizing efforts to this end,

